import React from 'react';
import { useOutletContext } from 'react-router-dom';

function Home() {
  const { filteredNames } = useOutletContext();

  return (
    <>

      <input
        type='text'
        placeholder='search person'
        // Implement onChange to update the filtered names
      />
      <br/>
      <small>{JSON.stringify(filteredNames())}</small>

      <small className="bottom" id="glass">
        Home
      </small>
    </>
  );
}

export default Home;
